package beispiel2_kleines_ein_mal_eins;

public class KleinesEinMalEins {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		for(int x = 1; x <= 10; x++){
			for(int y = 1; y <= 10; y++){
				System.out.print(x*y+"\t");
			}
			System.out.println("");
			}
		
		
	}

}
